const del = ms => new Promise(res => setTimeout(res, ms));

function loadState (state) {
  tinyMCE.activeEditor.dom.doc.body.innerHTML = state;
  try {
    oldState = state;
  } catch (e) {}
}

function lastItem (A) { return A[A.length-1]; };

async function test(editor) {
  // lorem Ã¨ 100 KB, 0,1 MB
  //[1,2,4,10]

  editor.windowManager.open({
    title: 'Download State',
    body: {
      type: 'panel',
      items: [{ type: 'input', name: 'mega', label: 'Con quanti megabyte vuoi testare?'}]
    },
    buttons: [
      { type: 'cancel', text: 'Close' },
      { type: 'submit', text: 'Test', primary: true }
    ],
    onSubmit: async function (api) {
      var data = api.getData();
      var mega = data.mega;
      loadState(lorem.repeat(10*mega));
      for (let i = 0; i<40; i++){
        //console.log(i);
        tinymce.activeEditor.selection.select(tinymce.activeEditor.dom.select('p')[0], true);
        tinyMCE.activeEditor.execCommand('mceToggleFormat', false, "h1");
        await del(400);
      }

      console.log("Test is done");
    }
  });


}

